<!doctype html><html><head><meta charset="utf-8"/><title>Webpack App</title></head><body><h1>Hello world!</h1><h2>Tip: Check your console</h2><script>if ('serviceWorker' in navigator) {
                window.addEventListener('load', () => {
                    navigator.serviceWorker
                        .register('/sw.js')
                        .then((registration) => {
                            console.log('SW registered: ', registration);
                        })
                        .catch((registrationError) => {
                            console.log('SW registration failed: ', registrationError);
                        });
                });
            }</script><script src="runtime~voyage.js"></script><script src="516.js"></script><script src="voyage.js"></script></body></html>
